import React from "react";
import Navbar from "../components/navbar";

import "../stylesheet/balanced.css"; 
import { useTranslation } from 'react-i18next';

export default function Balanced() {
    const {t} = useTranslation(); 
    return (
        <>
        <Navbar/>
        <div>
            <h1>Balanced</h1>
        </div>
        </>
    );
}
